import { BrowserRouter as Router, Route } from 'react-router-dom'

import { Join } from "./components/join/join";
import { Chat } from "./components/chat/main/chat";

const App = () => (
  <Router>
      <Route path='/' exact component={Join} />
      <Route path='/chat' component={Chat} />
    </Router>
)

export default App;
